import React from 'react';

const PesquisarCliente = ({ clientes }) => {
    return (
        <div>
            <label>
                <span>Informe o nome do cliente: </span>
                <input name="myInput" />
            </label>
            <button>
            Pesquisar
            </button>
        </div>



    );
};

export default PesquisarCliente;
